import React from "react";
import Content from "./components/Content";
import { PartProvider } from "./context/PartContext";
import { styled } from "styled-components";

function App() {
  return (
    <PartProvider>
      <Wrapper>
        <Title>
          숙명여대 멋쟁이사자처럼 <span>파트</span> 구성원
        </Title>
        <Content />
      </Wrapper>
    </PartProvider>
  );
}

export default App;

const Wrapper = styled.div`
  width: 100vw;
  min-height: 100vh;
  background: #f5f5f5;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 20px;
`;

const Title = styled.div`
  text-align: center;
  padding: 20px 0;
  font-size: 32px;
  font-weight: 700;
  color: #333;
  span {
    color: #ee7521;
  }
`;
